	//Farm Schematics
	public static void generateFarm(World world, int x, int y, int z, int dir)
	{
		if(dir == 3)
		{
			generateFarmThree(world, x, y, z);
		}
		else if(dir == 2)
		{
			generateFarmTwo(world, x, y, z);
		}
		else if(dir == 1)
		{
			generateFarmOne(world, x, y, z);
		}
		else if(dir == 0)
		{
			generateFarmZero(world, x, y, z);
		}
		world.playSoundEffect(x, y, z, "random.levelup", 0.75F, 1.0F);
	}

