	//Windmill Schematics
	public static void generateWindmill(World world, int x, int y, int z, int dir)
	{
		if(dir == 3)
		{
			generateWindmillThree(world, x, y, z);
		}
		else if(dir == 2)
		{
			generateWindmillOne(world, x, y, z);
		}
		else if(dir == 1)
		{
			generateWindmillTwo(world, x, y, z);
		}
		else if(dir == 0)
		{
			generateWindmillZero(world, x, y, z);
		}
		world.playSoundEffect(x, y, z, "random.levelup", 0.75F, 1.0F);
	}

