	//Tower Schematics
	public static void generateTower(World world, int x, int y, int z, int dir)
	{
		if(dir == 3)
		{
			generateTowerOne(world, x, y, z);
		}
		else if(dir == 2)
		{
			generateTowerTwo(world, x, y, z);
		}
		else if(dir == 1)
		{
			generateTowerThree(world, x, y, z);
		}
		else if(dir == 0)
		{
			generateTowerZero(world, x, y, z);
		}
		world.playSoundEffect(x, y, z, "random.levelup", 0.75F, 1.0F);
	}
	
	
